import axios from 'axios';

export const addData = (data) => {
  console.log('actions.js adding data. This is the data', data);
  try {
    const res = axios.post('http://localhost:5000/create/add_weight', data);
    console.log('result from adding data is', res);
  } catch (e) {
    console.log('problem with adding weight', e);
  }
};
